;(function($){
	'use strict';

	function initMobileHeader() {

    $(".header__trigger").click(function() {
      $(".header__main").toggleClass("header__main_active");
      $(".header__trigger").toggleClass("header__trigger_active");
    })


		$(document).on("click tap", function(e) {
			if ( ( $(".header__main_active")[0] ) && ( !$(e.target).closest(".header__main")[0] ) && ( !$(e.target).closest(".header__trigger")[0] ) ) {
				$(".header__main.header__main_active").removeClass("header__main_active");
				$(".header__trigger.header__trigger_active").removeClass("header__trigger_active");
			}
		})

	}

	$(document).ready(function(){
		initMobileHeader();
	});

})(window.jQuery)

;(function($){
	'use strict';


	function initHomeBannerSlider() {

		if ( $(".home-banner")[0] ) {

			$(".home-banner").each(function(){

				// init sliders
				var $slider = $(this).find(".home-banner__slider");
				$slider.addClass("swiper-container");

				$slider.append("<div class=\"home-banner__hand home-banner__hand_backward\"></div>");
				$slider.append("<div class=\"home-banner__hand home-banner__hand_forward\"></div>");

				var $wrapper = $slider.find(".home-banner__list");
				$wrapper.addClass("swiper-wrapper");

				var $slide = $slider.find(".home-banner__item");
				$slide.addClass("swiper-slide");

				if ( $slide.length > 1 ) {
	
					var args = {
						loop: true,
						spaceBetween: 0,
						slidesPerView: 1,
						// pagination: {
						//   el: '.news__pagination',
						//   type: 'bullets',
						// }
						navigation: {
							prevEl: '.home-banner__hand_backward',
							nextEl: '.home-banner__hand_forward',
						},
					};
	
					var homeBannerSlider = new Swiper($slider, args);
				}
			})
		}

	}



	$(document).ready(function(){
		initHomeBannerSlider();
	});

})(window.jQuery)

;(function($){
	'use strict';

	function initLanguages() {

		if ( screen.width > 769 ) {

			// open language
		  $(".language__label").click(function() {
		    $(".language__label").toggleClass("language__label_active");
		    $(".language__dropdown").toggleClass("language__dropdown_active");
		  })

		  // close dropdowns when click outside
			$(document).on("click tap", function(e) {

				if ( ( $(".language__dropdown_active")[0] ) && ( !$(e.target).closest(".language")[0] ) ) {
					$(".language__label.language__label_active").removeClass("language__label_active");
					$(".language__dropdown.language__dropdown_active").removeClass("language__dropdown_active");
				}

			})

		}
	}


	$(document).ready(function(){
		initLanguages();
	});

})(window.jQuery)

;(function($){
	'use strict';


	function initnewsSliders() {

		if ( $(".news.news_slider")[0] ) {

			$(".news.news_slider").each(function(){

				// init sliders
				var $slider = $(this);
				$slider.addClass("swiper-container");

				$slider.append("<div class=\"news__pagination swiper-pagination\"></div>");

				var $wrapper = $slider.find(".news__list");
				$wrapper.addClass("swiper-wrapper");

				var $slide = $slider.find(".news__item");
				$slide.addClass("swiper-slide");

				if ( screen.width >= 1024 ) {
					var args = {
						loop: false,
						spaceBetween: $slider.width() * 0.05,
						slidesPerView: 2, // $slider.width() * 47.5,
						pagination: {
							el: '.news__pagination',
							type: 'bullets',
						}
					}
				} else {
					var args = {
						loop: false,
						// centeredSlides: true,
						spaceBetween: 20,
						slidesPerView: 1.4,
						pagination: {
							el: '.news__pagination',
							type: 'bullets',
						}
					}
				}

				var similarSlider = new Swiper($slider, args);

			})
		}

	}



	$(document).ready(function(){
		initnewsSliders();
	});

})(window.jQuery)

;(function($){
	'use strict';


	function initnewsSliders() {

		if ( $(".services-slider")[0] ) {

			$(".services-slider").each(function(){

				// init sliders
				var $slider = $(this).find(".services-slider__slider");
				$slider.addClass("swiper-container");

				$slider.append("<div class=\"services-slider__pagination swiper-pagination\"></div>");

				var $wrapper = $slider.find(".services-slider__list");
				$wrapper.addClass("swiper-wrapper");

				var $slide = $slider.find(".services-slider__item");
				$slide.addClass("swiper-slide");

				if ( screen.width >= 1024 ) {
					var args = {
						loop: false,
						slidesPerView: 3,
						spaceBetween: 20,
						// slidesPerView: "auto",
						pagination: {
							el: '.services-slider__pagination',
							type: 'bullets',
						}
					}
				} else {
					var args = {
						loop: false,
						slidesPerView: 1.2,
						spaceBetween: 20,
						centeredSlides: true,
						pagination: {
							el: '.services-slider__pagination',
							type: 'bullets',
						}
					}
				}

				var homeServicesSlider = new Swiper($slider, args);

				$slider.height( $slider.height() );

				$(".trash-types__tab[data-tab]").click(function(){
					var tab = $(this).attr("data-tab");
					$(".trash-types__tab.trash-types__tab_active").removeClass("trash-types__tab_active");
					$(this).addClass("trash-types__tab_active");
					console.log(tab);
					if ( tab == "all" ) {
						$(".services-slider__item").show(200);
					} else {
						$(".services-slider__item[data-type="+tab+"]").show(200);
						$(".services-slider__item[data-type!="+tab+"]").hide(200);
					}
					setTimeout(function(){
						homeServicesSlider.update();
					}, 200)
				})

			})
		}

	}



	$(document).ready(function(){
		initnewsSliders();
	});

})(window.jQuery)
